import React from 'react';
import './Climb.css';

function Climb() {
  return (
    <div className="climb-container">
        <h1 className='form-title'>Recent Sends</h1>
        <div className='climb-item'>
            User 
        </div>
        <div className='climb-item'>
            Type
        </div>
        <div className='climb-item'>
            Gym 
        </div>
        <div className='climb-item'>
            Grade
        </div>
        <div className='climb-item'>
            Rating 
        </div>
    </div>
  );
}

export default Climb;
